"use strict";(self.webpackChunkGreenscape=self.webpackChunkGreenscape||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/garden","metadata":{"permalink":"/blog/garden","editUrl":"https://github.com/jannelson36/GreenScape/edit/main/blog/garden.mdx","source":"@site/blog/garden.mdx","title":"How To Add A Garden Page","description":"Attention all aspiring gardeners who can\'t follow these simple steps:","date":"2023-10-04T05:15:42.000Z","formattedDate":"October 4, 2023","tags":[{"label":"gardens","permalink":"/blog/tags/gardens"}],"readingTime":2.32,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"How To Add A Garden Page","tags":["gardens"],"sidebar_position":2},"nextItem":{"title":"Creating an Exciting Event with Us","permalink":"/blog/index"}},"content":"**Attention all aspiring gardeners who can\'t follow these simple steps:**\\n\\nIf you find yourself stumped by the task of creating a garden post, don\'t worry! Gardening can be tough, and we\'re here to help.\\n\\nSimply reach out to our support team, and they\'ll lend you a green thumb, a watering can, and maybe even a few gardening jokes to brighten your day. We\'re always here to assist, no matter how many seeds you accidentally plant in your keyboard.\\n\\nRemember, even the mightiest oak was once a little nut that held its ground. So, if you can\'t follow these instructions, don\'t be afraid to leaf us a message! \ud83c\udf31\ud83c\udf33\ud83e\udeb4\\n\\n\\n![Creating Garden](https://github.com/jannelson36/GreenScape/blob/main/static/Open%20Garden%20(1920%20%C3%97%201080px)%20(1).gif?raw=true)\\n\\n*Image source: [greenscape.example](https://greenscape.example)*\\n\\n\\n\\n## Add A New Garden \ud83c\udf31\u200d\ud83c\udf3e\ud83c\udf3f\ud83c\udf37\u2618\ufe0f\ud83c\udf3b\ud83c\udf4a\ud83c\udf45\ud83e\udd52\ud83d\udc0c\ud83c\udf46\ud83c\udf39\\nCreate a file at `gardens/NameOfGarden.md`:\\n\\nCongratulations, you have made your first post!\\n\\nFeel free to play around and edit this post as much you like.\\n\\nA new blog post is now available at `/gardens/greetings`.\\n\\n\\n# Markdown Features\\n\\nDocusaurus supports **[Markdown](https://daringfireball.net/projects/markdown/syntax)** and a few **additional features**.\\n\\n## Front Matter\\n\\nMarkdown documents have metadata at the top called [Front Matter](https://jekyllrb.com/docs/front-matter/):\\n\\n```text title=\\"my-doc.md\\"\\n// highlight-start\\n---\\nid: my-doc-id\\ntitle: My document title\\ndescription: My document description\\nslug: /my-custom-url\\n---\\n// highlight-end\\n\\n## Markdown heading\\n\\nMarkdown text with [links](./hello.md)\\n```\\n\\n## Links\\n\\nRegular Markdown links are supported, using url paths or relative file paths.\\n\\n```md\\nLet\'s see how to [Create a page](/index).\\n```\\n\\n\\n**Result:** Let\'s see how to [Create a page](./index.mdx).\\n\\n\\n**Result:** Let\'s see how to [Create a page](./index.mdx).\\n\\n## Images\\n\\nRegular Markdown images are supported.\\n\\nAdd an image at `static/img/docusaurus.png` and display it in Markdown:\\n\\n```md\\n![Docusaurus logo](/img/docusaurus.png)\\n```\\n\\n![Docusaurus logo](/img/docusaurus.png)\\n\\n## Code Blocks\\n\\nMarkdown code blocks are supported with Syntax highlighting.\\n\\n    ```jsx title=\\"src/components/HelloDocusaurus.js\\"\\n    function HelloDocusaurus() {\\n        return (\\n            <h1>Hello, Docusaurus!</h1>\\n        )\\n    }\\n    ```\\n\\n```jsx title=\\"src/components/HelloDocusaurus.js\\"\\nfunction HelloDocusaurus() {\\n  return <h1>Hello, Docusaurus!</h1>;\\n}\\n```\\n\\n## Admonitions\\n\\nDocusaurus has a special syntax to create admonitions and callouts:\\n\\n    :::tip My tip\\n\\n    Use this awesome feature option\\n\\n    :::\\n\\n    :::danger Take care\\n\\n    This action is dangerous\\n\\n    :::\\n\\n:::tip My tip\\n\\nUse this awesome feature option\\n\\n:::\\n\\n:::danger Take care\\n\\nThis action is dangerous\\n\\n:::\\n\\n## MDX and React Components\\n\\n[MDX](https://mdxjs.com/) can make your documentation more **interactive** and allows using any **React components inside Markdown**:\\n\\n```jsx\\nexport const Highlight = ({children, color}) => (\\n  <span\\n    style={{\\n      backgroundColor: color,\\n      borderRadius: \'20px\',\\n      color: \'#fff\',\\n      padding: \'10px\',\\n      cursor: \'pointer\',\\n    }}\\n    onClick={() => {\\n      alert(`You clicked the color ${color} with label ${children}`)\\n    }}>\\n    {children}\\n  </span>\\n);\\n\\nThis is <Highlight color=\\"#25c2a0\\">Docusaurus green</Highlight> !\\n\\nThis is <Highlight color=\\"#1877F2\\">Facebook blue</Highlight> !\\n```\\n\\nexport const Highlight = ({children, color}) => (\\n  <span\\n    style={{\\n      backgroundColor: color,\\n      borderRadius: \'20px\',\\n      color: \'#fff\',\\n      padding: \'10px\',\\n      cursor: \'pointer\',\\n    }}\\n    onClick={() => {\\n      alert(`You clicked the color ${color} with label ${children}`);\\n    }}>\\n    {children}\\n  </span>\\n);\\n\\nThis is <Highlight color=\\"#25c2a0\\">Docusaurus green</Highlight> !\\n\\nThis is <Highlight color=\\"#1877F2\\">Facebook blue</Highlight> !"},{"id":"/index","metadata":{"permalink":"/blog/index","editUrl":"https://github.com/jannelson36/GreenScape/edit/main/blog/index.mdx","source":"@site/blog/index.mdx","title":"Creating an Exciting Event with Us","description":"Garden Events","date":"2023-10-04T05:15:42.000Z","formattedDate":"October 4, 2023","tags":[{"label":"events","permalink":"/blog/tags/events"}],"readingTime":1.705,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"Creating an Exciting Event with Us","tags":["events"],"sidebar_position":1},"prevItem":{"title":"How To Add A Garden Page","permalink":"/blog/garden"}},"content":"![Garden Events](https://github.com/jannelson36/GreenScape/blob/main/static/Discover%20The%20Joy%20Of%20Gardening-modified.png?raw=true)\\n\\nAt Greenscape, we believe in making your events memorable and hassle-free. Whether it\'s a conference, seminar, workshop, or a special celebration, we\'re here to help you create an unforgettable experience. Follow these steps to get started:\\n\\n## Step 1: Reach Out to Us\\n\\n**Contact Information:**\\n- **Email:** [events@greenscape.example](mailto:events@greenscape.example)\\n- **Phone:** +1 (123) 456-7890\\n\\nOur dedicated event planning team is ready to assist you. Get in touch with us via email or give us a call. We\'re eager to hear about your event ideas and requirements.\\n\\n## Step 2: Initial Consultation\\n\\nOnce you contact us, we\'ll schedule an initial consultation to discuss your event vision, goals, and any specific needs you may have. This is a crucial step where we\'ll gather important details to tailor the event to your liking.\\n\\n## Step 3: Customized Event Proposal\\n\\nBased on our consultation, we\'ll create a customized event proposal for your review. This proposal will outline:\\n\\n- Event concept and theme.\\n- Budget estimate.\\n- Venue options.\\n- Catering and entertainment suggestions.\\n- Event timeline.\\n\\n## Step 4: Fine-Tuning\\n\\nWe\'ll work closely with you to fine-tune the event proposal until it perfectly aligns with your vision. This includes making any necessary adjustments and addressing your feedback.\\n\\n## Step 5: Event Planning and Execution\\n\\nOnce the proposal is approved, our team will swing into action, taking care of all the event planning details:\\n\\n- Securing the venue.\\n- Coordinating with vendors.\\n- Designing invitations and promotional materials.\\n- Managing logistics and timelines.\\n\\n## Step 6: Enjoy Your Event\\n\\nOn the big day, you can relax and enjoy your event while we handle everything behind the scenes. Our goal is to make sure your event runs smoothly and leaves a lasting impression.\\n\\n## Step 7: Feedback and Future Events\\n\\nAfter your event, we value your feedback. Your insights help us improve our services. We also look forward to helping you plan future events and continue our successful partnership.\\n\\nContact us today, and let\'s start planning your next incredible event!\\n\\n![Event Planning](https://raw.githubusercontent.com/jannelson36/GreenScape/main/static/logo.png)\\n\\n*Image source: [greenscape.example](https://greenscape.example)*\\n\\n---"}]}')}}]);